import React, {Component} from 'react';

import { Card,
         CardImg,
         CardBody,
         CardSubtitle,
         Col,
         Table
         } from 'reactstrap';


import PropTypes from 'prop-types';

import "../App.css";

class Product extends Component {
  render () {
    const {id, name, img, taste, price, weight } = this.props.product;
    return (

     <Col key={id} xs={6} sm={6} md={6}lg={4}>
      <Card className="box">
        <CardImg top width="5%" src={img} alt="Card image cap" />
        <CardBody>
          <CardSubtitle>{name}</CardSubtitle>
          <br/>
          <Table>
           <thead>

        </thead>
        <tbody>
          <tr>
            <th scope="row">Harga : </th>
            <td>Mark</td>
            <td>Otto</td>
            <td>@mdo</td>
          </tr>
          <tr>
            <th scope="row">2</th>
            <td>Jacob</td>
            <td>Thornton</td>
            <td>@fat</td>
          </tr>
          <tr>
            <th scope="row">3</th>
            <td>Larry</td>
            <td>the Bird</td>
            <td>@twitter</td>
          </tr>
        </tbody>
      </Table>
          <p> Rp {price},- </p>
          <p>Rasa: {taste}</p>
          <p>Berat : {weight} gram</p>
        </CardBody>
      </Card>
     </Col>
   );
  };
}

Product.propTypes = {
  product:PropTypes.shape({
   id:PropTypes.number,
   img:PropTypes.string,
   name:PropTypes.string,
   price:PropTypes.string,
   weight:PropTypes.number
 }).isRequired
}

export default Product;
